Bleach Screensaver




Download and Enjoy this FREE SCREENSAVER

Now With Amazing Effects and Sound!




Bleach is a Japanese shonen manga series written and illustrated by Noriaki Tite Kubo. Bleach follows the adventures of Ichigo Kurosaki after he obtains the powers of a Soul Reaper (Shinigami, literally, Death God) a death personification similar to the Grim Reaper, from another Soul Reaper, Rukia Kuchiki. His newfound powers force him to take on the duties of defending humans from evil spirits and guiding departed souls to the afterlife.


